import React from "react";
import {
  SafeAreaView,
  Text,
  View,
  TouchableOpacity,
  StyleSheet,
} from "react-native";
import { Ionicons } from "@expo/vector-icons";

export default function Home({ navigation }) {
  const renderHeader = () => {
    return (
      <View>
        <View
          style={{
            flexDirection: "row",
            justifyContent: "space-between",
            width: "55%",
            alignItems: "center",
            marginLeft: 25,
            marginTop: 10
          }}
        >
          <TouchableOpacity>
          <Ionicons name="chevron-back" size={34} color="black" /></TouchableOpacity>
          <Text style={{
            fontSize: 25,
            fontWeight:'bold'
          }}>Matchs</Text>
        </View>
        <TouchableOpacity>
          <Text>Information</Text>
        </TouchableOpacity>
      </View>
    );
  };

  return <SafeAreaView style={styles.container}>{renderHeader()}</SafeAreaView>;
}

const styles = StyleSheet.create({
  container: {
    display: "flex",
    height: "100%",
    width: "100%",
  },
});
